      individual spent more than 25% of their compensated time in a given month on
      Federal Election Activity or activities in connection with a Federal Election.  Those
      individuals who spent 25% or less of their compensated time in a given month
      on FEA or activities in connection with a Federal Election were paid with Federal
      funds and allocated on Schedule H4.  In either case, all amounts spent for employee
      specific ''fringe benefits,'' consisting of health insurance, disability insurance,
